import React, { useState, useEffect } from 'react';
import axios from 'axios';

function App() {
  const [url, setUrl] = useState('https://ops.trella.app/loadboard/shp7ac748256d2b60a4');
  const [actions, setActions] = useState(JSON.stringify([
    {
      "target": "div#addComment > div:nth-of-type(2) > div > div:nth-of-type(2) > div",
      "type": "click"
    },
    {
      "target": "div#addComment > div:nth-of-type(2) > div > div:nth-of-type(2) > div",
      "type": "input",
      "value": "a"
    },
    {
      "target": "div#addComment > div:nth-of-type(2) > div > div:nth-of-type(2) > div",
      "type": "input",
      "value": "a"
    },
    {
      "target": "div#addComment > div:nth-of-type(2) > div:nth-of-type(2) > button > span",
      "type": "click"
    }
  ], null, 2));
  const [mobileNumber, setMobileNumber] = useState('01022464134');
  const [password, setPassword] = useState('941114');
  const [result, setResult] = useState('');
  const [error, setError] = useState('');
  const [isAuthenticated, setIsAuthenticated] = useState(false);
  const [isCheckingAuth, setIsCheckingAuth] = useState(true);
  const serverPort = 3000;

  useEffect(() => {
    checkAuthStatus();
  }, []);

  const checkAuthStatus = async () => {
    setIsCheckingAuth(true);
    try {
      const response = await axios.get(`http://localhost:${serverPort}/auth-status`);
      setIsAuthenticated(response.data.isAuthenticated);
    } catch (error) {
      console.error('Error checking auth status:', error);
      setError('Failed to check authentication status');
    } finally {
      setIsCheckingAuth(false);
    }
  };

  const handleGoogleAuth = () => {
    window.open(`http://localhost:${serverPort}/google`, '_blank', 'width=500,height=600');
    // Poll for auth status changes
    const pollInterval = setInterval(async () => {
      const response = await axios.get(`http://localhost:${serverPort}/auth-status`);
      if (response.data.isAuthenticated) {
        setIsAuthenticated(true);
        clearInterval(pollInterval);
      }
    }, 1000);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError('');
    setResult('');
    try {
      let parsedActions;
      try {
        parsedActions = JSON.parse(actions);
      } catch (parseError) {
        throw new Error('Invalid JSON format for actions');
      }

      const response = await axios.post(`http://localhost:${serverPort}/automate`, {
        url,
        actions: parsedActions,
        mobileNumber,
        password
      });
      setResult(JSON.stringify(response.data, null, 2));
    } catch (error) {
      console.error('Error:', error);
      setError(
        `Error: ${error.message}\n\n` +
        `Response: ${JSON.stringify(error.response?.data, null, 2)}\n\n` +
        `Stack: ${error.stack}`
      );
    }
  };

  const handleFileUpload = (e) => {
    const file = e.target.files[0];
    if (file) {
      const reader = new FileReader();
      reader.onload = (e) => {
        setActions(e.target.result);
      };
      reader.readAsText(file);
    }
  };

  if (isCheckingAuth) {
    return <div>Checking authentication status...</div>;
  }

  return (
    <div className="App">
      <h1>Web Interaction Automation</h1>
      {!isAuthenticated ? (
        <div>
          <p>You need to authenticate with Google before running the automation.</p>
          <button onClick={handleGoogleAuth}>Authenticate with Google</button>
        </div>
      ) : (
        <p>Authenticated with Google</p>
      )}
      <form onSubmit={handleSubmit}>
        <div>
          <label htmlFor="url">URL:</label>
          <input
            type="text"
            id="url"
            value={url}
            onChange={(e) => setUrl(e.target.value)}
            required
          />
        </div>
        <div>
          <label htmlFor="mobileNumber">Mobile Number:</label>
          <input
            type="text"
            id="mobileNumber"
            value={mobileNumber}
            onChange={(e) => setMobileNumber(e.target.value)}
            required
          />
        </div>
        <div>
          <label htmlFor="password">Password:</label>
          <input
            type="password"
            id="password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            required
          />
        </div>
        <div>
          <label htmlFor="actions">Actions (JSON):</label>
          <textarea
            id="actions"
            value={actions}
            onChange={(e) => setActions(e.target.value)}
            required
          />
        </div>
        <div>
          <label htmlFor="file-upload">Or upload JSON file:</label>
          <input
            type="file"
            id="file-upload"
            accept=".json"
            onChange={handleFileUpload}
          />
        </div>
        <button type="submit" disabled={!isAuthenticated}>
          {isAuthenticated ? 'Run Automation' : 'Authenticate to Run Automation'}
        </button>
      </form>
      {error && (
        <div style={{ color: 'red', marginTop: '10px' }}>
          <h2>Error:</h2>
          <pre>{error}</pre>
        </div>
      )}
      {result && (
        <div style={{ marginTop: '10px' }}>
          <h2>Result:</h2>
          <pre>{result}</pre>
        </div>
      )}
    </div>
  );
}

export default App;
